Мешканці столиці привозять до Кінологічного центру поліції Києва поранених під час обстрілів собак. Кінологи надають необхідну ветеринарну допомогу братам нашим меншим 🐕🚓🇺🇦🙏

У зв’язку з російським вторгненням багато українців змушені покидати свої домівки: виїжджати в інші регіони або бігти в укриття. 

У багатьох є домашні улюбленці. Не залишайте їх у помешканях, адже без вашої допомоги і турботи вони не можуть. Пам‘ятайте про відповідальність про тих, кого приручили.

Є декілька порад:

▫️ подбайте про достатню кількість корму та переноску для тварини;
▫️ наклейте на нашийник наліпку з вашими контактними даними;
▫️ за можливості віддайте домашнього улюбленця на деякий час знайомим, які зможуть прихистити улюбленця;
▫️ якщо у вас немає власного авто, попросіть друзів чи знайомих перевезти тварину у безпечне місце.

